GeneralJs.orderSystem = function (type, number) {
  if (number === undefined) {
    number = type;
    type = "encode";
  }
  const ABC = [ "a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z" ];
  let a1, a2, a0;
  let n1, n2;
  let target, index0, index1, result;
  let lastInitialArr, num;
  let a, s, z;

  lastInitialArr = [];
  a = 'a'.charCodeAt(0);
  s = 's'.charCodeAt(0);
  z = 'z'.charCodeAt(0);
  for (let i = a; i < z + 1; i++) {
    num = i + (s - a);
    if (num > z) {
      lastInitialArr.push(String.fromCharCode(num - z - 1 + a));
    } else {
      lastInitialArr.push(String.fromCharCode(num));
    }
  }

  if (type === "encode") {

    if (typeof number !== "number") {
      throw new Error("encode input must be number");
    }
    if (number >= ((ABC.length - 1) * 100 * (ABC.length)) + ((ABC.length - 1) * 100) + (9 * 10) + (9 * 1) + ((ABC.length - 1) * 100 * (ABC.length) * (ABC.length)) + 1) {
      throw new Error("too heavy number");
    }

    n2 = (number % 10);
    n1 = (((number - n2) % (10 * 10)) / 10);
    a2 = ABC[((number - n2 - (n1 * 10)) % (ABC.length * 10 * 10)) / (10 * 10)];
    a1 = ABC[((number - n2 - (n1 * 10) - (ABC.indexOf(a2) * 10 * 10)) % (ABC.length * ABC.length * 10 * 10)) / (ABC.length * 10 * 10)];
    a0 = lastInitialArr[((number - n2 - (n1 * 10) - (ABC.indexOf(a2) * 10 * 10) - (ABC.indexOf(a1) * ABC.length * 10 * 10)) % (ABC.length * ABC.length * ABC.length * 10 * 10)) / (ABC.length * ABC.length * 10 * 10)];

    return (a1 + a2 + String(n1) + String(n2) + a0);

  } else if (type === "decode") {

    if (typeof number !== "string") {
      throw new Error("decode input must be string");
    }

    if (number.length === 11) {
      target = number.split("_")[1].trim();
    } else if (number.length === 5) {
      target = number.trim();
    } else {
      throw new Error("invaild id");
    }

    index0 = 0;
    index1 = 0;
    for (let i = 0; i < ABC.length; i++) {
      if (ABC[i] === target[0]) {
        index0 = i;
      }
      if (ABC[i] === target[1]) {
        index1 = i;
      }
    }
    result = (index0 * 100 * 26) + (index1 * 100) + (Number(target[2]) * 10) + (Number(target[3]) * 1) + (lastInitialArr.indexOf(target[4]) * 100 * 26 * 26);

    return result;

  } else {
    throw new Error("orderSystem type must be 'encode' or 'decode'");
  }
}

GeneralJs.promiseTogether = function (promiseArr) {
  if (!Array.isArray(promiseArr)) {
    throw new Error("invaild input");
  }
  if (!promiseArr.every((obj) => { return obj instanceof Promise })) {
    throw new Error("invaild input");
  }
  return new Promise((resolve, reject) => {
    const workLength = promiseArr.length;
    let promiseTong, interval, timeout;

    promiseTong = [];

    for (let i = 0; i < workLength; i++) {
      promiseArr[i].then(() => {
        promiseTong.push(true);
      }).catch((err) => {
        reject(err);
      })
    }

    interval = setInterval(() => {
      if (promiseTong.length >= workLength) {
        timeout = setTimeout(() => {
          resolve(true);
          clearTimeout(timeout);
        }, 0);
        clearInterval(interval);
      }
    }, 100);
  });
}

GeneralJs.homeliaisonAnalytics = function (obj) {
  let dimension, gtagObject;
  return new Promise((resolve, reject) => {
    if (typeof obj !== "object" || obj === null) {
      resolve(null);
    } else {
      if (window.location.host === "localhost:3000" || window.location.host === "localhost:8080" || window.location.host === "localhost" || /^172/gi.test(window.location.host) || /^192/gi.test(window.location.host) || /1.229.181.6/gi.test(window.location.host)) {
        const json = {
          date: {
            now: new Date(),
          },
          data: {
            page: obj.page,
            action: obj.action,
            id: "",
            value: { ...obj.data }
          }
        };
        resolve(json);
      } else {
        if (typeof window.homeliaisonSessionId === "string" && /^homeliaison/i.test(window.homeliaisonSessionId)) {
          obj.id = window.homeliaisonSessionId;
          obj.info = {
            ip: window.homeliaisonClientInfo.ip,
            userAgent: window.homeliaisonClientInfo.userAgent,
            referer: window.encodeURIComponent(window.homeliaisonClientInfo.referer),
            requestUrl: window.encodeURIComponent(window.homeliaisonClientInfo.requestUrl),
          };
          if (typeof window.homeliaisonClientInfo.pageTitle === "string") {
            obj.info["pageTitle"] = window.encodeURIComponent(window.homeliaisonClientInfo.pageTitle);
          }
          if (typeof obj.dimension === "object" && obj.dimension !== null) {
            dimension = JSON.parse(JSON.stringify(obj.dimension));
            if (typeof obj.data === "object" && obj.data !== null) {
              for (let key in dimension) {
                obj.data[key] = dimension[key];
              }
            }
            delete obj.dimension;
          } else {
            dimension = null;
          }
          GeneralJs.ajaxJson(obj, LOGHOST + "/getAnalytics").then(() => {
            const json = {
              id: obj.id,
              info: obj.info,
              page: obj.page,
              action: obj.action,
              standard: obj.standard.valueOf(),
              date: (new Date()).valueOf(),
              ...obj.data
            };
            if (typeof window.fbq === "function") {
              window.fbq("trackCustom", obj.action, json);
            }
            if (typeof window.gtag === "function") {
              if (dimension !== null) {
                gtagObject = {
                  "event_category": obj.page,
                  "event_label": JSON.stringify(json),
                  ...dimension,
                };
              } else {
                gtagObject = {
                  "event_category": obj.page,
                  "event_label": JSON.stringify(json),
                };
              }
              window.gtag("event", obj.action, gtagObject);
            }
            resolve({
              date: {
                standard: new Date(),
                now: new Date(),
              },
              data: json,
            });
          }).catch((err) => {
            reject(err);
          })
        } else {
          reject("invalid id");
        }
      }
    }
  });
}

