              removeByClass(promptAsideClassName);
  
              thisDesid = desid;
              [ thisDesigner ] = await ajaxJson({ noFlat: true, whereQuery: { desid: thisDesid } }, SECONDHOST + "/getDesigners", { equal: true });
  
              clientSearch = await GeneralJs.prompt("고객 이름, 또는 아이디를 입력해주세요!");
